BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "usuario" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_persona"	INTEGER NOT NULL,
	"usuario"	TEXT NOT NULL,
	"correo"	TEXT,
	"clave"	TEXT NOT NULL,
	"resetear_clave"	INTEGER NOT NULL DEFAULT 0,
	"pregunta1"	INTEGER,
	"respuesta1"	TEXT,
	"pregunta2"	INTEGER,
	"respuesta2"	TEXT,
	"pregunta3"	INTEGER,
	"respuesta3"	TEXT,
	FOREIGN KEY("id_persona") REFERENCES "persona"("id")
);
CREATE TABLE IF NOT EXISTS "configuracion_usuario" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_usuario"	INTEGER NOT NULL,
	"id_ciclo_contable"	INTEGER,
	"avatar"	TEXT NOT NULL DEFAULT '/utils/avatar/avatar1.png'
);
CREATE TABLE IF NOT EXISTS "partida_detalle" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_partida"	INTEGER NOT NULL,
	"id_cuenta"	INTEGER NOT NULL,
	"parcial"	NUMERIC,
	"debe"	NUMERIC,
	"haber"	NUMERIC
);
CREATE TABLE IF NOT EXISTS "partida" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_ciclo"	INTEGER NOT NULL,
	"num_partida"	INTEGER NOT NULL,
	"comentario"	TEXT NOT NULL,
	"fecha"	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "ciclo_contable" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"titulo"	TEXT NOT NULL,
	"desde"	TEXT NOT NULL,
	"hasta"	TEXT,
	"id_catalogo"	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS "cuenta" (
	"id"	INTEGER NOT NULL,
	"codigo"	TEXT NOT NULL,
	"ref"	TEXT,
	"nombre"	TEXT NOT NULL,
	"id_tipo_catalogo"	INTEGER,
	"nivel"	INTEGER,
	"tipo_saldo"	TEXT NOT NULL,
	"ingresos"	TEXT,
	"egresos"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "persona" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"nombres"	TEXT NOT NULL,
	"apellidos"	TEXT NOT NULL,
	"tipo"	INTEGER NOT NULL DEFAULT 1,
	"carnet"	TEXT
);
CREATE TABLE IF NOT EXISTS "tipo_catalogo" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"tipo"	TEXT NOT NULL,
	"ref"	INTEGER
);
COMMIT;
